import "./App.css";
import React, { Component } from "react";

import axios from "axios";

class GamesList extends Component {
  constructor() {
    super();
    this.state = {
      socapi: []
    };
  }

  componentDidMount() {
    axios.get(`http://127.0.0.1:8000/socapi`).then(response => {
      this.setState({
        socapi: response.data
      });
    });
  }

  render() {
    const { socapi } = this.state;
    return (
      <ul>
        {socapis.map(soc => (
          <li>{soc.id}</li>
        ))}
      </ul>
    );
  }
}
export default GamesList;
